import React from 'react'

export const NavBar = (props) => {
  return (
    <nav class="border-b border-gray-700">
    <div class="py-4 flex justify-between items-center">
      <h1 class="text-3xl font-bold text-white hover:text-gray-300">
        Codepen Clone
      </h1>
    </div>
  </nav>
  )
}
